import React from "react";

const SingleCampus = () => {
    return (
        <div>
            <h1>Welcome to the Single Campus View</h1>
            <button type="button" class="btn btn-danger">Delete</button>
            <form>
                <label for="name">Campus Name:</label>
                <input type="text" placeHolder="Name"/>
                <label for="imageUrl">Campus Image URL:</label>
                <input type="text" placeHolder="http://www.image.com/"/>
                <label for="description">Description:</label>
                <input type="text" placeHolder="Describe this campus"/>
                {/* placeHolder is only for input for label */}
            </form>
        </div>
    )
}

export default SingleCampus;
